import React from 'react';
import './App.css';
import {link} from'react-router-dom';

function Nav() {
  return(
    <nav>
        <h3>Logo</h3>
        <ui className="nav-links">
            <Link>
                <li>About</li>
            </Link>
            <Link>
                <li>Shop</li>
            </Link>
        </ui>
    </nav>
  );
};


export default Nav;
